import React from 'react';
import { useState, useEffect, useRef } from 'react';
import "./HomePage.css";
import logo from "./img/projlogo.jpg";

function HomePage(){

    return (
        <div className="Login">
            <img src={logo}></img>
            <p>Welcome!<br>To the childTranspot Website <br>real time location <br>less time waiting<br> safe child transport<br>and much more</br></br></br></br></br></p>
        </div>

    )

}

export default HomePage;
